CREATE DEFINER=`root`@`localhost` EVENT `populate_alert_table` ON SCHEDULE EVERY 5 SECOND STARTS '2024-11-10 17:29:06' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    -- Insert alert for smoke detection
    SELECT sr.deviceID, sr.readingID, u.email, 'smoke' AS gastype, sr.ppm, t.smoke_threshold, NOW(), 1
    FROM sensor_reading sr
    JOIN thresholds t ON sr.deviceID = t.deviceID
    JOIN user u ON u.status = 0
    WHERE sr.smoke_status = 1
      AND NOT EXISTS (
          SELECT 1 FROM alert a
          WHERE a.readingID = sr.readingID AND a.gastype = 'smoke'
          AND TIMESTAMPDIFF(SECOND, a.timestamp, sr.timestamp) < 120
      );

    -- Insert alert for CO detection
    SELECT sr.deviceID, sr.readingID, u.email, 'co' AS gastype, sr.ppm, t.co_threshold, NOW(), 1
    FROM sensor_reading sr
    JOIN thresholds t ON sr.deviceID = t.deviceID
    JOIN user u ON u.status = 0
    WHERE sr.co_status = 1
      AND NOT EXISTS (
          SELECT 1 FROM alert a
          WHERE a.readingID = sr.readingID AND a.gastype = 'co'
          AND TIMESTAMPDIFF(SECOND, a.timestamp, sr.timestamp) < 120
      );

    -- Insert alert for LPG detection
    SELECT sr.deviceID, sr.readingID, u.email, 'lpg' AS gastype, sr.ppm, t.lpg_threshold, NOW(), 1
    FROM sensor_reading sr
    JOIN thresholds t ON sr.deviceID = t.deviceID
    JOIN user u ON u.status = 0
    WHERE sr.lpg_status = 1
      AND NOT EXISTS (
          SELECT 1 FROM alert a
          WHERE a.readingID = sr.readingID AND a.gastype = 'lpg'
          AND TIMESTAMPDIFF(SECOND, a.timestamp, sr.timestamp) < 120
      );
END$$

CREATE DEFINER=`root`@`localhost` EVENT `update_device_status` ON SCHEDULE EVERY 1 SECOND STARTS '2024-11-10 17:01:14' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    -- Update the status of devices to 0 if no reading has been recorded in the last 10 seconds
    UPDATE device d
    SET status = 0
    WHERE d.status = 1 AND NOT EXISTS (
        SELECT 1
        FROM sensor_reading sr
        WHERE sr.deviceID = d.deviceID
        AND sr.timestamp > NOW() - INTERVAL 5 SECOND
    );

    -- Update the status of devices to 1 if there is a recent reading
    UPDATE device d
    SET status = 1
    WHERE d.status = 0 AND EXISTS (
        SELECT 1
        FROM sensor_reading sr
        WHERE sr.deviceID = d.deviceID
        AND sr.timestamp > NOW() - INTERVAL 5 SECOND
    );
END$$

